import '../../styles/itemComponent.css';
import itemCartComponent from './itemCartComponent';
const ItemComponent = ({ id, title, price, image }) => {
  return (
    <div className="content-body-item-product">
      <itemCartComponent />
    </div>
  );
};
export default ItemComponent;
